// Recursive function to refactor items
function refactorItem(item) {
    if (item.type === "table" && item.dataSettings) {
        // Convert single dataSource to dataSources array
        item.dataSettings.sqlSettings.dataSources = [{
            dataSource: item.dataSettings.dataSource,
            tableName: "main"
        }];
        
        // Convert single query to queries array
        item.dataSettings.sqlSettings.queries = [{
            query: String(item.dataSettings.sqlSettings.query).replaceAll("?", "main"),
            note: ""
        }];
        
        // Remove old single-value properties
        delete item.dataSettings.dataSource;
    }
    
    // Recursively process children
    if (item.children && Array.isArray(item.children)) {
        item.children.forEach(child => refactorItem(child));
    }
}

// Process all top-level items
itemsToModify.forEach(item => refactorItem(item));

// Save refactored items to file
const fs = require('fs');
const path = require('path');

const outputPath = path.join(__dirname, 'refactored_items.json');
fs.writeFileSync(outputPath, JSON.stringify(itemsToModify, null, 2));

console.log(`✓ Refactored items saved to: ${outputPath}`);